sources.Taxi.js:
import Phaser from 'phaser'
class Taxi extends Phaser.GameObjects.Sprite {
    constructor(scene, x, y, identifier) {
        super(scene, x, y, 'cab');
        this.identifier = identifier;
        this.waited = 0
    }
}
